DROP TABLE IF EXISTS `sys_medical_record`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `sys_medical_record` (
  `record_id` bigint NOT NULL AUTO_INCREMENT COMMENT '记录编号',
  `user_id` bigint DEFAULT NULL COMMENT '用户ID',
  `md` double(5,2) DEFAULT NULL COMMENT 'MD值',
  `psd` double(5,2) DEFAULT NULL COMMENT 'PSD值',
  `bh` double(5,2) DEFAULT NULL COMMENT '杯盘比值',
  `um` double(5,2) DEFAULT NULL COMMENT '角膜厚度',
  `rnfl` double(5,2) DEFAULT NULL COMMENT 'RNFL值',
  `medical_time` datetime DEFAULT NULL COMMENT '就诊日期',
  `hospital` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '就诊医院',
  `remark` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`record_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=103 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='就诊记录表';
