INSERT INTO `sys_notice` VALUES (6,'华西有“EYE”科普小分队携手文轩成功举办粉丝线下分享会','2',_binary '<p><strong>华西有“EYE”科普小分队携手文轩成功举办粉丝线下分享会</strong></p><p><strong><span class=\"ql-cursor\">﻿</span></strong><img src=\"data:image/jpeg;base64,\"></p>','0','','2021-06-13 18:22:40','',NULL,NULL,'罗文娟','3月30日',_binary '<p><img src=\"data:image/jpeg;base64,\"></p>'),(7,'”视野不丢，生活无忧“——世界青光眼周义诊宣教活动','2',_binary '<p><img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-indent-6\"><strong style=\"background-color: rgb(204, 232, 204);\" class=\"ql-size-large\">世|界|青|光|眼|周</strong></p><p class=\"ql-indent-3\"><strong class=\"ql-size-large\" style=\"background-color: rgb(204, 232, 204);\">3月7日至3月13日是第十四个“世界青光眼周”</strong></p><p class=\"ql-indent-6\"><br></p>','0','','2021-06-13 19:59:46','',NULL,NULL,'姚瑞','3月21日',_binary '<p><img src=\"data:image/jpeg;base64,\"></p>'),(9,'“华西有’EYE‘科普小分队”走进新都','2',_binary '<h1 class=\"ql-indent-2\"><span style=\"background-color: rgb(102, 185, 102); color: rgb(255, 255, 255);\">华西有“EYE”下基层</span></h1><p>2021年3月7-13日是第十四个“世界青光眼周”。青光眼是世界第二大致盲性眼病和首位不可逆致盲性疾病。</p>','0','','2021-06-13 20:08:57','',NULL,NULL,'张鑫','3月21日',_binary '<p><img src=\"data:image/jpeg;base64,\"></p>'),(10,'什么是青光眼','2',_binary '<h1><span style=\"color: rgb(102, 185, 102);\">|什么是青光眼？</span></h1><p><span class=\"ql-size-large\">青光眼是由于眼压水平升高超过了视神经的承受能力，而造成视神经损害的一种严重致盲性眼病。</span></p><p><img src=\"data:image/jpeg;base64,\"></p>','0','','2021-06-13 20:12:03','','2021-06-13 20:15:52',NULL,'四川大学华西医院眼科','2016-12-17',_binary '<p><img src=\"data:image/jpeg;base64,\"></p>');
/*!40000 ALTER TABLE `sys_notice` ENABLE KEYS */;
UNLOCK TABLES;

--
-- Table structure for table `sys_oper_log`
